syntax = "proto3";

package io.seata.protocol.protobuf;

import "AbstractBranchEndRequest.proto";


option java_multiple_files = true;
option java_outer_classname = "BranchRollbackRequest";
option java_package = "io.seata.protocol.core.protobuf";

// PublishRequest is a publish request.
message BranchRollbackRequest {
    AbstractBranchEndRequest abstractBranchEndRequest = 1;
}